import React from 'react'

const Home = (props) => {
    return (
        <div>
            <span><h1>The Wonder Years Care</h1></span>
            <li>
            {props.getDaycare.name} <br />
            {props.getDaycare.address}<br /><br />
            </li>
        </div>
    )
}
export default Home
